#Creating Win32_BIOS fake class
$newClass = New-Object System.Management.ManagementClass("root\cimv2", [String]::Empty, $null); 
$newClass["__CLASS"] = "Win32_BIOS";
$newClass.Qualifiers.Add("Static", $true)

$objWMi = get-wmiobject -computername localhost -Namespace root\CIMV2 -Query "Select * from Win32_BIOS"

foreach ($obj in $objWmi)
{
	foreach ($pr in $obj.Properties)
	{
		if($pr.Name -eq "SerialNumber")
		{	$value = Get-RandomCharacters -length 10 -characters 'ABCDEFGHKLMNOPRSTUVWXYZ123456789'

			$newClass.Properties.Add($pr.Name, $value, $pr.Type)
			$newClass.Properties[$pr.Name].Qualifiers.Add("Key", $true)
		} elseif($pr.Name -eq "BIOSVersion")
		{
			$value = Get-RandomCharacters -length 10 -characters 'ABCDEFGHKLMNOPRSTUVWXYZ123456789'

			$newClass.Properties.Add($pr.Name, @($value), $pr.Type)
		} elseif($pr.Name -eq "Manufacturer" -or $pr.Name -eq "Version" -or $pr.Name -eq "SMBIOSBIOSVersion")
		{
			$value = Get-RandomCharacters -length 5 -characters 'ABCDEFGHKLMNOPRSTUVWXYZ123456789'

			$newClass.Properties.Add($pr.Name, $value, $pr.Type)
		} else
		{
			$newClass.Properties.Add($pr.Name, $pr.Value, $pr.Type)
		}
	}
}

$newClass.Put()
Set-WmiInstance -Path \\.\root\cimv2:Win32_BIOS 

