#Creating Win32_Processor fake class
$newClass = New-Object System.Management.ManagementClass("root\cimv2", [String]::Empty, $null); 
$newClass["__CLASS"] = "Win32_Processor";
$newClass.Qualifiers.Add("Static", $true);

$objWMi = get-wmiobject -computername localhost -Namespace root\CIMV2 -Query "Select * from Win32_Processor"

if(-Not ($objWMi -is [array]))
{
	$objWMi = @($objWMi)
}

foreach ($pr in $objWmi[0].Properties)
{
	$newClass.Properties.Add($pr.Name, $pr.Type, $false)	
	if($pr.Name -eq "ProcessorId")
	{
		$newClass.Properties[$pr.Name].Qualifiers.Add("Key", $true)
	}
	$newClass.Properties[$pr.Name].Qualifiers.Add("read", $true)
}

$newClass.Put()

foreach ($obj in $objWmi)
{	
	$args = @{}
	foreach ($pr in $obj.Properties)
	{	
		if($pr.Name -eq "ProcessorId")
		{
			$value = Get-RandomCharacters -length 10 -characters 'ABCDEF0123456789'
			$args.add($pr.Name, $value)
		} elseif($pr.Name -eq "Name" -and $pr.Value -match 'Xeon')
		{
			$value = $pr.Value.replace("Xeon", "Core")
			$args.add($pr.Name, $pr.Value)
			
		} elseif($pr.Name -eq "NumberOfCores" -and $pr.Value -lt 4)
		{
			$args.add($pr.Name, 4)
		} else
		{
			$args.add($pr.Name, $pr.Value)
		}
	}
	Set-WmiInstance -Path \\.\root\cimv2:Win32_Processor -Arguments $args
}

